Latest vid is up on YouTube! Retiring from professional Sx/Mx after 14 years was not easy, especially when that’s all you’ve done for almost 30 years! I knew it was going to be tough making it through a MN winter unless I had a goal to keep me busy in those sub zero temperatures 🥶
But I have genuinely enjoyed the training that went into this @lamarathon taking place tomorrow! 

Post retirement has definitely been a change of pace but its reminded me the importance of having goals, accountability and that hard work can benefit every stage of your life. Let’s goooo!! 

