LA marathon vid is live! This was such a cool experience, I really enjoyed the whole process in preparing for this race! Most of my training runs were solo this winter so to line up with 17k+ other runners was kinda wild! Official time was 2:59:01. I suppose Boston is on the bucket list now… 😏

